INSERT INTO `notices` VALUES (1557,'r','Quelle salade !','Kakerlaken salat','','',2,6,6,99,20,0,'',26,0,0,0,'','','','','','','','','','','','http://www.dreimagier.de/produkt-detail/product/kakerlakensalat-40839.html','','',0,'','','m','0',1,'','','','','Chacun à leur tour, les joueurs déposent une carte sur la pile en annonçant le légume qu\'ils déposent, mais attention, ils seront forcés de mentir si ce légume a été déposé ou nommé juste avant... ou si un cafard apparait sur la carte retournée!','','',' quelle salade kakerlaken salat ','  Quelle salade ! Kakerlaken salat  ',1,'','2017-08-18 16:47:49','2017-09-22 12:38:54','0','http://docker:32888/pmb/opac_css/getimage.php?noticecode=&vigurl=&notice_id=1557','0000-00-00',NULL,1,1,'fr_FR',0,0,0,'',0,'0000-00-00 00:00:00',1);
INSERT INTO `notices` VALUES (1559,'r','Gorilla','','','',3,5,5,99,20,0,'',25,0,0,0,'','','','','','','','','','','','','','',0,'','','m','0',1,'','','','','Jeu de stratégie et de rapidité.Pour gagner il faut associer les animaux ou les couleurs de bus afin de ne plus avoir de cartes en main.Attention ! Seuls les joueurs les plus rapides sauront éviter les gorilles.','','',' gorilla ','  Gorilla   ',1,'','2017-08-18 17:29:47','2017-09-22 12:35:56','0','http://docker:32888/pmb/opac_css/getimage.php?noticecode=&vigurl=&notice_id=1559','0000-00-00',NULL,1,1,'fr_FR',0,0,0,'',0,'0000-00-00 00:00:00',1);
INSERT INTO `notices` VALUES (1563,'r','Time\'s up ! Family','','','',4,12,8,99,30,0,'',520,0,0,0,'','','','','','','','','','','','https://fr.asmodee.com/fr/games/times-up/products/times-up-family/','','Ambiance;Jeux familiaux',0,'',' ambiance jeux familiaux ','m','0',1,'','','','','Les joueurs doivent se répartir en équipes et faire deviner à leurs partenaires un maximum de noms de personnalités connues. Chaque manche se différencie par le moyen utilisé pour faire deviner les noms (explications, mimes, 1 mot uniquement,...etc.)','','Jeu de langage, d\'association d\'idées et d\'énigmes qui invite les joueurs à faire des liens entre le mot recherché et les indices donnés. Ce jeu nécessite rapidité d\'esprit, mémoire et connaissances générales toujours avec de l\'humour.',' time s up family ','  Time\'s up ! Family   ',1,'','2017-08-21 14:05:13','2017-09-22 10:03:12','0','http://docker:32888/pmb/opac_css/getimage.php?noticecode=&vigurl=&notice_id=1563','0000-00-00',NULL,1,1,'fr_FR',0,0,0,'',0,'0000-00-00 00:00:00',1);
