INSERT INTO `notices_custom_values` VALUES (6,1557,NULL,'Les joueurs préparent le plus vite possible une salade composée en posant leurs cartes Légumes à tour de rôle. Le problème c’est qu’ils doivent également annoncer le nom du légume correspondant aussi vite qu’ils les posent, sans mettre les pieds dans le plat. Mais attention, pour gagner il faudra jongler astucieusement entre vérité et mensonge forcé et ce, sans la moindre erreur ! Chou promis, chou dû !',NULL,NULL,NULL);
INSERT INTO `notices_custom_values` VALUES (9,1557,NULL,'1 r&eacute;gle du jeu<br />120 cartes L&eacute;gumes<br />8 cartes L&eacute;gumes tabous',NULL,NULL,NULL);
