INSERT INTO `notices_custom_values` VALUES (7,1563,NULL,'Jeu de langage, d\'association d\'idées et d\'énigmes qui invite les joueurs à faire des liens entre le mot recherché et les indices donnés. Ce jeu nécessite rapidité d\'esprit, mémoire et connaissances générales toujours avec de l\'humour.',NULL,NULL,NULL);
