INSERT INTO `notices_custom_values` VALUES (6,1565,NULL,'Les Jeux du Syllabozoo constituent un équipement complémentaire à l’outil de base, le Syllabozoo. L’objet de ce livret est de présenter les activités que l’enseignant peut conduire avec cette boîte de jeux.',NULL,NULL,NULL);
INSERT INTO `notices_custom_values` VALUES (7,1565,NULL,'Les activités animées à partir du Syllabozoo et de ses Jeux amènent les enfants à parler sur le langage : ils apprennent à l’analyser d’un point de vue phonologique (ils s’installent dans le « métalangage »). Ils construisent aussi de premières connaissances sur la relation oral-écrit (notion de syllabe, notions de début et de fi n de mot, première approche de la grapho-phonologie, etc.). En outre, ils observent et dénomment les parties du corps des animaux, etc.',NULL,NULL,NULL);
INSERT INTO `notices_custom_values` VALUES (6,1563,NULL,'Time\'s Up! est un jeu d\'équipe qui se joue en 3 manches différentes. Durant chaque manche, devinez un maximum de cartes !',NULL,NULL,NULL);
