INSERT INTO `notices_fields_global_index` VALUES (1565,100,7,7,'Les activités animées à partir du Syllabozoo et de ses Jeux amènent les enfants à parler sur le langage : ils apprennent à l’analyser d’un point de vue phonologique (ils s’installent dans le « métalangage »). Ils construisent aussi de premières connaissances sur la relation oral-écrit (notion de syllabe, notions de début et de fi n de mot, première approche de la grapho-phonologie, etc.). En outre, ils observent et dénomment les parties du corps des animaux, etc.',100,'','0');
INSERT INTO `notices_fields_global_index` VALUES (1559,90,3,1,'A 406 Jeu de stratégie',100,'','');
