INSERT INTO `notices_fields_global_index` VALUES (1557,90,3,1,'A 401 Jeu d\'association',100,'','');
INSERT INTO `notices_fields_global_index` VALUES (1557,100,6,0,'Les joueurs préparent le plus vite possible une salade composée en posant leurs cartes Légumes à tour de rôle. Le problème c’est qu’ils doivent également annoncer le nom du légume correspondant aussi vite qu’ils les posent, sans mettre les pieds dans le plat. Mais attention, pour gagner il faudra jongler astucieusement entre vérité et mensonge forcé et ce, sans la moindre erreur ! Chou promis, chou dû !',100,'','0');
INSERT INTO `notices_fields_global_index` VALUES (1559,100,6,0,'Pour gagner il faut associer les animaux ou les couleurs de bus afin de ne plus avoir de cartes en main. Attention ! Seuls les joueurs les plus rapides sauront éviter les gorilles.',100,'','0');
INSERT INTO `notices_fields_global_index` VALUES (1563,100,6,2,'Time\'s Up! est un jeu d\'équipe qui se joue en 3 manches différentes. Durant chaque manche, devinez un maximum de cartes !',100,'','0');
INSERT INTO `notices_fields_global_index` VALUES (1564,100,6,3,'Le jeu se compose de paires de cartes portant des illustrations identiques. L\'ensemble des cartes est mélangé, puis étalé face contre table. À son tour, chaque joueur retourne deux cartes de son choix. S\'il découvre deux cartes identiques, il les ramasse et les conserve, ce qui lui permet de rejouer. Si les cartes ne sont pas identiques, il les retourne faces cachées à leur emplacement de départ. Le jeu se termine quand toutes les paires de cartes ont été découvertes et ramassées. Le gagnant est le joueur qui possède le plus de paires. Une variante possible consiste en l\'introduction d\'une carte sans appariement, qui reste donc la dernière carte en jeu après que toutes les paires ont été découvertes.',100,'','0');
INSERT INTO `notices_fields_global_index` VALUES (1565,100,6,6,'Les Jeux du Syllabozoo constituent un équipement complémentaire à l’outil de base, le Syllabozoo. L’objet de ce livret est de présenter les activités que l’enseignant peut conduire avec cette boîte de jeux.',100,'','0');
