INSERT INTO `notices_global_index` VALUES (1557,1,'    Quelle salade ! Kakerlaken salat       Rüttinger Johann      Kappler Léna      Vogt Rolf      Zeimet Jacques      A 401 jeu d\'association (jeu de règles) Discrimination visuelle Ambiance Jeux familiaux Observation Rapidité Drei Magier Spiele Les joueurs préparent le plus vite possible une salade composée en posant leurs cartes Légumes à tour de rôle. Le problème c’est qu’ils doivent également annoncer le nom du légume correspondant aussi vite qu’ils les posent, sans mettre les pieds dans le plat. Mais attention, pour gagner il faudra jongler astucieusement entre vérité et mensonge forcé et ce, sans la moindre erreur ! Chou promis, chou dû ! 1 r&eacute;gle du jeu<br />120 cartes L&eacute;gumes<br />8 cartes L&eacute;gumes tabous 20 99 6 6 2  ','   quelle salade kakerlaken salat      ruttinger johann kappler lena vogt rolf zeimet jacques 401 jeu association jeu regles discrimination visuelle ambiance jeux familiaux observation rapidite drei magier spiele joueurs preparent plus vite possible salade composee posant leurs cartes legumes tour role probleme c est qu ils doivent egalement annoncer nom legume correspondant aussi vite qu ils posent sans mettre pieds dans plat mais attention pour gagner il faudra jongler astucieusement entre verite mensonge force ce sans moindre erreur chou promis chou 1 r eacute gle jeu br 120 cartes eacute gumes br 8 cartes eacute gumes tabous 20 99 6 6 2 ');
INSERT INTO `notices_global_index` VALUES (1559,1,'    Gorilla        Girardet Stéphane      A 406 jeu de stratégie (jeu de règles) Jeux de cartes Couleurs Djeco Pour gagner il faut associer les animaux ou les couleurs de bus afin de ne plus avoir de cartes en main. Attention ! Seuls les joueurs les plus rapides sauront éviter les gorilles. 1 r&eacute;gle du jeu<br />45 cartes 5 5 99 20 3  ','   gorilla      girardet stephane 406 jeu strategie jeu regles jeux cartes couleurs djeco pour gagner il faut associer animaux ou couleurs bus afin ne plus avoir cartes main attention seuls joueurs plus rapides sauront eviter gorilles 1 r eacute gle jeu br 45 cartes 5 5 99 20 3 ');
INSERT INTO `notices_global_index` VALUES (1563,1,'    Time\'s up ! Family       Ambiance;Jeux familiaux Sarrett Peter      A 410 jeu de langage et d\'expression (jeu de règles) Langue  Ambiance Jeux familiaux Repos Production 1 r&egrave;gle de jeu<br />1 carnet de r&eacute;sultats<br />220 cartes<br />1 sablier<br />1 sac en toile Jeu de langage, d\'association d\'idées et d\'énigmes qui invite les joueurs à faire des liens entre le mot recherché et les indices donnés. Ce jeu nécessite rapidité d\'esprit, mémoire et connaissances générales toujours avec de l\'humour. Time\'s Up! est un jeu d\'équipe qui se joue en 3 manches différentes. Durant chaque manche, devinez un maximum de cartes ! 30 99 4 12 8  ','   time s up family      ambiance jeux familiaux  sarrett peter 410 jeu langage expression jeu regles langue ambiance jeux familiaux repos production 1 r egrave gle jeu br 1 carnet r eacute sultats br 220 cartes br 1 sablier br 1 sac toile jeu langage association idees enigmes qui invite joueurs faire liens entre mot recherche indices donnes ce jeu necessite rapidite esprit memoire connaissances generales toujours avec humour time s up est jeu equipe qui se joue 3 manches differentes durant chaque manche devinez maximum cartes 30 99 4 12 8 ');
INSERT INTO `notices_global_index` VALUES (1564,1,'    Disney\'s Tarzan Memory        A 401 jeu d\'association (jeu de règles) Mémoire Disney Ravensburger 4 99 15 Le jeu se compose de paires de cartes portant des illustrations identiques. L\'ensemble des cartes est mélangé, puis étalé face contre table. À son tour, chaque joueur retourne deux cartes de son choix. S\'il découvre deux cartes identiques, il les ramasse et les conserve, ce qui lui permet de rejouer. Si les cartes ne sont pas identiques, il les retourne faces cachées à leur emplacement de départ. Le jeu se termine quand toutes les paires de cartes ont été découvertes et ramassées. Le gagnant est le joueur qui possède le plus de paires. Une variante possible consiste en l\'introduction d\'une carte sans appariement, qui reste donc la dernière carte en jeu après que toutes les paires ont été découvertes. 8 2 72 cartes  ','   disney s tarzan memory      401 jeu association jeu regles memoire disney ravensburger 4 99 15 jeu se compose paires cartes portant illustrations identiques ensemble cartes est melange puis etale face contre table son tour chaque joueur retourne deux cartes son choix s il decouvre deux cartes identiques il ramasse conserve ce qui lui permet rejouer si cartes ne sont pas identiques il retourne faces cachees leur emplacement depart jeu se termine quand toutes paires cartes ont ete decouvertes ramassees gagnant est joueur qui possede plus paires variante possible consiste introduction carte sans appariement qui reste donc derniere carte jeu apres que toutes paires ont ete decouvertes 8 2 72 cartes ');
INSERT INTO `notices_global_index` VALUES (1565,1,'    Les jeux du Syllabozoo        Méhée Loïc      Ouzoulias André      A 410 jeu de langage et d\'expression (jeu de règles) Langue  Retz 3 planches glossaires<br />1 jeu de Memory (48 cartes)<br />1 jeu du Pouilleux (51 cartes)<br />1 jeu de Loto (8 planches et 64 cartes)<br />1 CD-Rom 2 6 4 8 15 Les Jeux du Syllabozoo constituent un équipement complémentaire à l’outil de base, le Syllabozoo. L’objet de ce livret est de présenter les activités que l’enseignant peut conduire avec cette boîte de jeux. Les activités animées à partir du Syllabozoo et de ses Jeux amènent les enfants à parler sur le langage : ils apprennent à l’analyser d’un point de vue phonologique (ils s’installent dans le « métalangage »). Ils construisent aussi de premières connaissances sur la relation oral-écrit (notion de syllabe, notions de début et de fi n de mot, première approche de la grapho-phonologie, etc.). En outre, ils observent et dénomment les parties du corps des animaux, etc.  ','   jeux syllabozoo      mehee loic ouzoulias andre 410 jeu langage expression jeu regles langue retz 3 planches glossaires br 1 jeu memory 48 cartes br 1 jeu pouilleux 51 cartes br 1 jeu loto 8 planches 64 cartes br 1 cd rom 2 6 4 8 15 jeux syllabozoo constituent equipement complementaire outil base syllabozoo objet ce livret est presenter activites que enseignant peut conduire avec cette boite jeux activites animees partir syllabozoo ses jeux amenent enfants parler sur langage ils apprennent analyser point vue phonologique ils s installent dans metalangage ils construisent aussi premieres connaissances sur relation oral ecrit notion syllabe notions debut fi n mot premiere approche grapho phonologie etc outre ils observent denomment parties corps animaux etc ');
