INSERT INTO `parametres` VALUES (1,'pmb','bdd_version','v5.19','Version de noyau de la base de données, à ne changer qu\'en version inférieure si un paramètre était mal passé et relancer la mise à jour. En général, contactez plutôt la mailing liste pmb.user@sigb.net','',0);
INSERT INTO `parametres` VALUES (2,'z3950','accessible','1','Z3950 accessible ?\r\n 0 : non, menu inaccessible\r\n 1 : Oui, la librairie PHP_YAZ est activée, la recherche z3950 est possible','',0);
